import React from "react";
import styled, { ThemeProvider } from "styled-components";
import Router from "./components/Router/Router";

const App = styled.div`
  margin: 0px;
  padding: 0px;
  & body {
    padding: 100px;
    margin: 0px;
  }
`;

const THEME = "dark";

export default function () {
  return (
    <App>
      <Router />
    </App>
  );
}
